import { configureStore } from '@reduxjs/toolkit';
import { navigationReducer, loadPath, changePath, previousPage } from './slices/navigationSlice';
import { loginReducer, changeLoginInput } from './slices/loginSlice';

const store = configureStore(
{
    reducer: 
    {
        navigation: navigationReducer,
        login: loginReducer
    }
});

const LOGIN_PAGE_PATH = "/applicantLogin";
const CONFIRM_PAGE_PATH = "/confirmExam";
const QUESTIONS_PAGE_PATH = "/examQuestions";

export { LOGIN_PAGE_PATH, CONFIRM_PAGE_PATH, QUESTIONS_PAGE_PATH }
export { loadPath, changePath,  changeLoginInput, previousPage, store };
